script: |
  super -f text -I q5830.spq | sort > q5830.out

inputs:
  - name: q5830.spq
    data: |
      SELECT DISTINCT * FROM tab2 (FORMAT parquet) WHERE + col0 * - + col2 * + col1 BETWEEN ( - col2 * + col1 * - 29 + + - col1 + - 57 ) AND - col2;
  - name: tab2

outputs:
  - name: q5830.out
    data: |
